import React from "react";
import { styledMovieThum } from "../styles/StyledMovieThumb";
const MovieThumb = ({ image, movieId, clickable }) => {
  return <styledMovieThum>Movie Thumb</styledMovieThum>;
};

export default MovieThumb;
